  false,\n\t\"url\": null,\n\t\"notes\": \"Parker River Refuge is currently developing
  a Habitat Management Plan, and expects a draft HMP by summer of 2006. The Refuge
  finalized a master plan in 1986; however, much of the wildlife goals and objectives
  from that planning effort are out of date. Current habitat management programs implemented
  on the Refuge are continuations of historic practices (impoundment and grassland
  management) or have been opportunistic (salt marsh restoration and invasive plant
  control). In this document, management strategies are outlined for each habitat
  management objective.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
